    "#coding ='utf-8'\n",
    "import datetime\n",
    "import cobra\n",
    "from cobra import Metabolite, Reaction, Model\n",
    "from cobra.io import write_sbml_model\n",
    "#from __future__ import print_function\n",
    "import pandas as pd\n",
    "myfolder='/media/jupyter/yu_wt//V.natriegens/data/'\n",
    "mname=myfolder+\"modelseed\"\n",
    "\n",
    "#\n",
    "#A = Metabolite('A')\n",
    "#model.add_metabolites([A, B, C, D, E, P])\n",
    "starttime = datetime.datetime.now()\n",
    "model = Model(mname)\n",
    "colnames=['id','reaction_eq','Subsys','lower_bound','upper_bound','objective_coefficient']\n",
    "#excel,\n",
    "#objr='Objective'  #\n",
    "#rin=[['PGI',-10,10]] #\n",
    "#,\n",
    "#data = pd.read_csv(mname+'.csv', delimiter=\",\", na_values=['(none)']).fillna('')\n",
    "data = pd.read_excel(mname+'.xlsx', sheet_name='reactions', header=0, na_values=['(none)']).fillna('')  #'(none)'NaNNaN''\n",
    "#print(data)\n",
    "#exceltxt,header dropna\n",
    "keys=data.keys()\n",
    "for index, row in data.iterrows():\n",
    "    r = Reaction(row[colnames[0]].strip())  #rname\n",
    "    model.add_reaction(r)\n",
    "    r.build_reaction_from_string(row[colnames[1]],fwd_arrow='-->', rev_arrow='<--', reversible_arrow='<=>', term_split='+')  #excelcolnames[1],SBML\n",
    "    if colnames[2] in keys:\n",
    "        r.subsystem=row[colnames[2]]\n",
    "    if colnames[3]in keys:\n",
    "        r.lower_bound=row[colnames[3]]\n",
    "        r.upper_bound=row[colnames[4]]\n",
    "    if colnames[4] in keys: #\n",
    "        if row[colnames[5]]:\n",
    "            r.objective_coefficient=row[colnames[5]]\n",
    "    #if colnames[5] in keys:\n",
    "    #    if row[colnames[5]]:\n",
    "    #       r.objective_coefficient=1\n",
    "    #s=row[colnames[6]] #and/or\n",
